pragma solidity ^0.4.24;

import "node_modules/openzeppelin-solidity/contracts/token/ERC721/ERC721Metadata.sol";
import "./Signer.sol";
import "./Document.sol";

contract TokenMetadata is ERC721Metadata, Document {

	mapping(uint256 => string) public _tokenURIs;
	/**
   * @dev Internal function to set the token URI for a given token
   * Reverts if the token ID does not exist
   * @param tokenId uint256 ID of the token to set its URI
   * @param uri string URI to assign
   */
  function _setTokenURI(uint256 tokenId, string uri, bytes32 docHash) allSigned(docHash) internal {
    require(_exists(tokenId));

    _tokenURIs[tokenId] = uri;
  }

}

